import { Navbar, Nav, Container } from 'react-bootstrap';
import { Link } from 'react-router-dom';

function Navbar1() {
  return (
    <Navbar className='main-navbar' collapseOnSelect expand="lg" variant="dark">
      <Container className='d-flex justify-content-between'>
        <Navbar.Brand><Link to="/welcome"><h1>BREWDOG</h1></Link></Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link> <Link to="/welcome">Tutte le birre</Link> </Nav.Link>
            <Nav.Link> <Link to="/random">Una birra a caso</Link> </Nav.Link>
            <Nav.Link> <Link to="/favourite">Favourites</Link> </Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  )
}
export default Navbar1;
